        for val in range(1, N*N + 1):
            if step == 0:
                dp[pos_val[val][0]][pos_val[val][1]][step] = val
            else:
                for dx, dy in directions:
                    x, y = pos_val[val]
                    nx, ny = x + dx, y + dy
                    if 0 <= nx < N and 0 <= ny < N:
                        dp[x][y][step] = min(dp[x][y][step], dp[nx][ny][step-1] + val)

    min_path_val = float('inf')
    min_path = []
    for i in range(N):
        for j in range(N):
            if dp[i][j][k-1] < min_path_val:
                min_path_val = dp[i][j][k-1]
