def encode(message):
    def swap_case(char):
        if char.islower():
            return char.upper()
        else:
            return char.lower()

    def replace_vowel(char):
        vowels = 'aeiouAEIOU'
        if char in vowels:
            return chr(((ord(char.lower()) - ord('a') + 2) % 26) + ord('a')).upper() if char.isupper() else chr(((ord(char.lower()) - ord('a') + 2) % 26) + ord('a'))
        else:
            return char

    encoded_message = ''
    for char in message:
        if char.isalpha():
            char = swap_case(char)
            char = replace_vowel(char)
        encoded_message += char
    return encoded_message

