def minPath(grid, k):
    from heapq import heappush, heappop

    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pq = [(grid[i][j], i, j, [grid[i][j]]) for i in range(N) for j in range(N)]
    visited = set()

    while pq:
        _, x, y, path = heappop(pq)
        if len(path) == k:
            return path
        if (x, y, len(path)) in visited:
            continue
        visited.add((x, y, len(path)))
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                heappush(pq, (path + [grid[nx][ny]], nx, ny, path + [grid[nx][ny]]))

def tri(n):
    def helper(n, memo):
        if n in memo:
            return memo[n]
        if n == 1:
            return 3
        if n % 2 == 0:
            memo[n] = 1 + n // 2
            return memo[n]
        else:
            memo[n] = helper(n - 1, memo) + helper(n - 2, memo) + helper(n + 1, memo)
            return memo[n]

    memo = {}
    for i in range(1, n + 2):
        helper(i, memo)

    return [memo[i] for i in range(1, n + 2)]

