def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]
    dp = [[float('inf')] * (k + 1) for _ in range(N * N)]
    pos = {grid[i][j]: (i, j) for i in range(N) for j in range(N)}

    for i in range(1, N * N + 1):
        dp[i - 1][1] = i

    for step in range(2, k + 1):
        for val in range(1, N * N + 1):
            x, y = pos[val]
            for dx, dy in directions:
                nx, ny = x + dx, y + dy
                if 0 <= nx < N and 0 <= ny < N:
                    prev_val = grid[nx][ny]
                    dp[val - 1][step] = min(dp[val - 1][step], dp[prev_val - 1][step - 1] * (N * N + 1) + val)

    min_path_val = min(dp[i][k] for i in range(N * N))
    path = []
    for _ in range(k):
        path.append(min_path_val % (N * N + 1))
        min_path_val //= (N * N + 1)

    return path[::-1]

