    def helper(n):
        if n in memo:
            return memo[n]
        if n % 2 == 0:
            memo[n] = 1 + n // 2
        else:
            memo[n] = helper(n - 1) + helper(n - 2) + helper(n + 1)
        return memo[n]
    for i in range(1, n + 2):
        helper(i)
    return [memo[i] for i in range(1, n + 2)]

