def encode(message):
    """
    Encode a message by swapping case of all letters and replacing vowels with the letter 2 places ahead.
    """
    vowels = 'aeiouAEIOU'
    vowel_replacement = {'a': 'c', 'e': 'g', 'i': 'k', 'o': 'q', 'u': 's',
                         'A': 'C', 'E': 'G', 'I': 'K', 'O': 'Q', 'U': 'S'}
    encoded_message = ''
    for char in message:
        if char in vowels:
            encoded_message += vowel_replacement[char]
        else:
            encoded_message += char
    return encoded_message.swapcase()

