    if len(parts) != 3:
        return False

    # Check if parts are integers
    try:
        month, day, year = int(parts[0]), int(parts[1]), int(parts[2])
    except ValueError:
        return False

    # Check month range
    if month < 1 or month > 12:
        return False

    # Check day range based on month
    if month in [1, 3, 5, 7, 8, 10, 12]:
        if day < 1 or day > 31:
            return False
    elif month in [4, 6, 9, 11]:
        if day < 1 or day > 30:
