def minPath(grid, k):
    from heapq import heappush, heappop

    N = len(grid)
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]
    pq = []  # Priority queue: (path_value_list, x, y, steps)
    for i in range(N):
        for j in range(N):
            heappush(pq, ([grid[i][j]], i, j, 1))

    while pq:
        path, x, y, steps = heappop(pq)
        if steps == k:
            return path
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                new_path = path + [grid[nx][ny]]
                heappush(pq, (new_path, nx, ny, steps + 1))

def tri(n):
    def helper(m, memo):
        if m in memo:
            return memo[m]
        if m == 1:
            return 3
        if m % 2 == 0:
            result = 1 + m // 2
        else:
            result = helper(m - 1, memo) + helper(m - 2, memo) + helper(m + 1, memo)
        memo[m] = result
        return result

    memo = {}
    result = []
    for i in range(1, n + 2):
        if i not in memo:
            helper(i, memo)
        result.append(memo[i])
    return result

def digits(n):
    product = 1
    has_odd = False
    while n > 0:
        digit = n % 10
        if digit % 2 != 0:
            product *= digit
            has_odd = True
        n //= 10
    return product if has_odd else 0

def is_nested(string):
    '''
    Create a function that takes a string as input which contains only square brackets.
    The function should return True if and only if there is a valid subsequence of brackets 
    where at least one bracket in the subsequence is nested.
    '''
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if stack:
                stack.pop()
            else:
                return False
    # If the stack is empty, it means all brackets were matched, but we need to check for nesting.
    # A string with all matched brackets but no nesting would have an even length but no characters left in the stack.
    # So, if the stack is not empty, it means there was at least one nested bracket.
    return len(string) % 2 == 0 and not stack

