def minPath(grid, k):
    from heapq import heappop, heappush

    N = len(grid)
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]
    pq = [(grid[i][j], k-1, i, j, [grid[i][j]]) for i in range(N) for j in range(N)]
    visited = set()

    while pq:
        cost, steps, x, y, path = heappop(pq)
        if (x, y, steps) in visited:
            continue
        visited.add((x, y, steps))
        if steps == 0:
            return path
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                new_path = path + [grid[nx][ny]]
                heappush(pq, (cost, steps-1, nx, ny, new_path))

    return []

def tri(n):
    def helper(n, memo):
        if n in memo:
            return memo[n]
        if n == 1:
            return 3
        elif n % 2 == 0:
            memo[n] = 1 + n // 2
        else:
            memo[n] = helper(n - 1, memo) + helper(n - 2, memo) + helper(n + 1, memo)
        return memo[n]

    memo = {}
    for i in range(1, n + 2):
        helper(i, memo)
    return [memo[i] for i in range(1, n + 2)]

def digits(n):
    product = 1
    has_odd = False
    while n > 0:
        digit = n % 10
        if digit % 2 != 0:
            product *= digit
            has_odd = True
        n //= 10
    return product if has_odd else 0

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']' and stack:
            stack.pop()
            if not stack:
                return True
    return False

